import { makeStyles } from '@material-ui/core/styles';

export const useStyles = makeStyles({
  card: {
    maxWidth: 224,
    height: 400
  },
  media: {
    height: 224,
    width: 224
  },
  notOverflow: {
    width: 224,
    whitespace: 'nowrap',
    textoverflow: 'ellipsis',
    overflow: 'hidden'
  }
});
